import useFetch from '../components/useFetch';

import styles from './EditProduct.module.css';

function EditProduct() {

    return(
        <div className={styles.editproduct}>
            <h1>Edit product</h1>
            {product.name ? (
                <div>
                    <p>{product.name}</p>
                    <p>{product.price}</p>
                    <p>{product.description}</p>
                </div>
            ): (
                <div>
                    <h1>No info!</h1>
                </div>
            )}
        </div>
    );
}

export default EditProduct;
